import React from 'react';

function PopularItems() {
  return (
    <div style={{ padding: '1rem' }}>
      <h2>Popular Items</h2>
      <ul>
        <li>Veg Thali</li>
        <li>Paneer Butter Masala</li>
        <li>Chicken Biryani</li>
      </ul>
    </div>
  );
}

export default PopularItems;
